const MAP_SIZE = 50;

this.options = {
  // root_mode: "survival",
  root_mode: "team",
  map_size: MAP_SIZE,
  soundtrack: "warp_drive.mp3",
  map_name: "Alien Mod by JavRedstone",
  // map_size: 100,
  crystal_value: 8,
  asteroids_strength: 0.05,
  station_crystal_capacity: 0.15,
  station_size: 2,
  station_regeneration: 0.75,
  all_ships_can_dock: true,
  friendly_colors: 2,
  ships: ships,
  radar_zoom: 1,
  strafe: 1,
  healing_enabled: true,
  map_density: 2,
  weapon_drop: 1,
  power_regen_factor: 2,
  speed_mod: 1.5,
  projectile_speed: 2,
  friction_ratio: 0.5,
  // choose_ship: [101, 102, 103] // only for nerd
  // choose_ship: [101, 103] // only for kest
};

var amount = 1;
var tp_rate = 1800; // change back to 1800

var ALIEN_SPAWN = 3.5;
var ASTEROID_SPEED = 2;

// Distance
const d1 = MAP_SIZE * 5 * 0.8;
const d2 = 30;

// Angle
var a1 = 0;
var a2 = 0;

// Amount added to the angle to create the change in speed / period of motion
const m1 = 0.001;
const m2 = 0.1;

// Trolling Max Tier
const max_tier = 400;

// Orbit function
const orbit = (d, a, m, asteroid, cx, cy, size) => {
  a += m;
  
  var x = d * Math.cos(a) + cx;
  var y = d * Math.sin(a) + cy;
  
  asteroid.set({
    x: x,
    y: y,
    vx: 0,
    vy: 0,
    size: size
  });
  
  return a;
};

// function getDistance(x1, y1, x2, y2) {
//     return Math.sqrt(Math.pow(x1 - x2, 2) + Math.pow(y1 - y2, 2));
