this.tick = function(game) {
  // 60 * 60 * 5
  if (game.step > 60 * 60 * 2 && game.step % 5 === 0) {
    amount = Math.ceil((game.step - 60 * 60 * 2) / (60 * 60 * 2));
    if (amount > 20) {
      amount = 20;
    }
        // var arr = [10, 11, 14, 16, 17, 18]; // alien
    var arr = [15] // hirsuite
    var arr2 = [10, 11, 40, 41, 42, 90, 91, 12]; // collectible, last one is only for alien
    var alien_code = arr[Math.floor(Math.random() * arr.length)];
    if (game.aliens.length < amount) {
      game.addAlien({code: alien_code, level: Math.floor(Math.random() * 3), crystal_drop: 600, weapon_drop: arr2[Math.floor(Math.random() * arr2.length)]});
    }
    for (let i = 0; i < game.aliens.length; i++) {
      var alien = game.aliens[i];
      if (i > 0) alien.set({x: game.aliens[0].x, y: game.aliens[0].y, vx: 0, vy: 0});
      var stats = {rate: 10, damage: amount * 7.5, laser_speed: 125, regen: 0, shield: 100};
      alien.set(stats);
    }
  }
  
  if (game.step > 500 && game.step % 5 === 0) {
    
    if (game.asteroids.length < 2) {
      // Earth
      game.addAsteroid({
        x: d1,
        y: 0,
        size: 100
      });
      
      // Moon
      game.addAsteroid({
        x: d1 + d2,
        y: 0,
        size: 50
      });
    }
    // Orbit the asteroids
    a1 = orbit(d1, a1, m1, game.asteroids[0], 0, 0, 100);
    a2 = orbit(d2, a2, m2, game.asteroids[1], game.asteroids[0].x, game.asteroids[0].y, 50);
    
    if (game.step % tp_rate === 0) {
      // echo("TP ALIEN, RATE IS " + tp_rate);
      tp_rate -= 30;
      if (tp_rate < 180) {
        tp_rate = 180;
      }
      game.addAsteroid({size: (Math.round(Math.random()) + 1) * 25,x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * 5, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * 5, vx:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * ASTEROID_SPEED, vy: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * ASTEROID_SPEED});
    }
    
    if (game.step % (tp_rate * 2) === 0) {
      game.aliens[0].set({x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * ALIEN_SPAWN, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * ALIEN_SPAWN});
    }
    
    if (game.step % 1200 === 0) {
      for (let i = 0; i < 50; i++) {
        game.addCollectible({code: arr2[Math.floor(Math.random() * (arr2.length - 1))], x:(Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * 5, y: (Math.round(Math.random()) == 0 ? 1 : -1) * Math.random() * MAP_SIZE * 5});
      }
    }
    
    for (let ship of game.ships) {
      if (ship.custom.a != true) {
        ship.custom.a = true;
        
        ship.custom.announcements = [];
    
        ship.custom.announce = function(announcement, type = 1) {
          if (type == 1) emoji = "";
          else if (type == 2) emoji = "";
          
          ship.custom.announcements.push(announcement);
          
          var components = [
            {
              type: "box",
              position: [0, 0, 100, 20],
              fill: "rgba(0, 0, 0, 0.4)",
              stroke: "rgb(255, 215, 0)",
              width: 3
            },
            {
              type: "text",
              position: [5, 2, 90, 16],
              color: "white",
              value: `Announcements for ${ship.name}:`
            },
            {
              type: "box",
              position: [20, 20, 80, 80],
              fill: "rgba(0, 0, 0, 0.2)",
              stroke: "white",
              width: 3
            },
            {
              type: "box",
              position: [0, 20, 20, 80],
              fill: "rgba(0, 0, 0, 0.2)",
              stroke: "white",
              width: 3
            },
            {
              type: "text",
              position: [0, 20, 20, 80],
              color: "white",
              value: emoji
            }
          ];
          
          var amount = 3;
          for (let i = 0; i < amount; i++) {
            var value = ship.custom.announcements[ship.custom.announcements.length - i - 1];
            if (value) {
              var text = {
                type: "text",
                position: [25, 10 + (i + 1) * 20, 70, 20],
                color: "white",
                align: "left",
                value: value
              }
              components.push(text);
            }
          }
          
          ship.setUIComponent({
            id: "announcement",
            position: [20, 10, 60, 20],
            clickable: false,
            visible: true,
            components: components
          });
        }
        
        ship.custom.hide_announcement = function() {
          ship.setUIComponent({
            id: "announcement",
            clickable: false,
            visible: false,
          });
          ship.custom.announcements = [];
        }
        
        echo(`Ship announcements were successfully installed for ${ship.name}`);
      }
      
      if (ship.shield < ship.type / 5 && ship.type < max_tier) {
        if (!ship.custom.antitroll) {
          ship.custom.announcements = [];
          ship.custom.announce("Your lasers are set to healing.");
          ship.custom.announce("Your antitroll is activated.");
          ship.custom.antitroll_timer = 240;
        }
        ship.custom.antitroll = true;
        ship.set({
          // invulnerable: 360,
          shield: ship.shield + 2,
          healing: true
        });
        
      }
      else {
        ship.custom.antitroll = false;
        ship.set({healing: false});
      }
      
      if (ship.custom.antitroll_timer) {
        ship.custom.antitroll_timer -= 5;
        if (ship.custom.antitroll_timer <= 0) {
          ship.custom.hide_announcement();
        }
      }
    }
    
    // if (game.step === 72000) {
    //   game.addAlien({code:20});
    //   for (let ship of game.ships) {
    //     ship.instructorSays("FINAL BOSS SPAWNED!");
    //   }
    // }
    
    // if (game.step === 72500) {
    //   for (let ship of game.ships) {
    //     ship.hideInstructor();
    //   }
    // }
    
    // game.addCollectible({code:12,x:game.ships[0].x,y:game.ships[0].y})
    
    // game.ships[1].set({invulnerable:500})
    // game.aliens[0].set({x:game.ships[1].x, y:game.ships[1].y})
  }
  
  if (game.step % 600 === 0) {
    for (let a = 0; a < game.ships.length; a++) {
      var ship = game.ships[a];
      echo(a+": "+ship.name);
    }
  }
}
